import { useState } from "react";
import "./style.css";
import Header from ""
import NewFactForm from "./NewFactForm";
import CategoryFilter from "./CategoryFilter";
import FactsList from "./FactsList";

function App() {
  const [showForm, setShowForm] = useState(false);

  return (
    <>
      <Header />
      {showForm ? <NewFactForm /> : null}
      <main className="main">
        <CategoryFilter />
        <FactsList />
      </main>
    </>
  );
}

export default App;
